import React from 'react';
import styled from "styled-components";
import Price from "./Price";

const Container = styled.div`

`;


const PriceCard = () => {
    return (
        <Container>
            <PriceContainer>
                $<Price>20</Price>/month
                <Type>Basic Plan</Type>
                
            </PriceContainer>
        </Container>
    );
};

export default PriceCard;
